    public function getSourceContext()
    {
        return new Twig_Source("{% use \"bootstrap_3_horizontal_layout.html.twig\" %}

{% block form_label_class -%}
col-md-offset-1 col-sm-2 
{%- endblock form_label_class %}

{% block form_group_class -%}
col-sm-8 col-md-6
{%- endblock form_group_class %}

{%- block choice_widget_options -%}
    {% for group_label, choice in options %}
        {%- if choice is iterable -%}
            <optgroup label=\"{{ choice_translation_domain is same as(false) ? group_label : group_label|trans({}, choice_translation_domain) }}\">
                {% set options = choice %}
                {{- block('choice_widget_options') -}}
            </optgroup>
        {%- else -%}
            <option value=\"{{ choice.value }}\" {{ block('attributes') }}{{ choice is selectedchoice(value) ? 'selected=\"selected\"'}}>{% for i in 0..get_start_white_space(choice.label) %}&nbsp;{% endfor %}{{ choice_translation_domain is same as(false) ? choice.label : choice.label|trans({}, choice_translation_domain) }}</option>
        {%- endif -%}
    {% endfor %}
{%- endblock choice_widget_options -%}

{%- block submit_widget -%}
    {% set attr = attr|merge({class: (attr.class|default('btn-primary btn-block') ~ ' btn')|trim}) %}
\t{{- parent() -}}
{%- endblock submit_widget -%}

{% block button_text_widget %}
   \t<button class=\"{{ button_style|default('btn btn-default') }} ' btn-block'\" value=\"{{ value }}\" type=\"{{ type|default('button') }}\" {{ block('button_attributes') }}>{{ label|trans({}, translation_domain) }}</button>
{% endblock %}
", "FGSBootstrapBundle:Form:fields.html.twig", "C:\\wamp64\\www\\GestionComptes-master\\src\\FGS\\BootstrapBundle/Resources/views/Form/fields.html.twig");
